import React from "react";

import "./Footer.css";


function Footer(){
  return(
    <>
    <nav>
        <a href="https://www.google.com">Google</a>
        <br />
        <a href="https://www.facebook.com">Facebook</a>
        <p>Author: Shadi Aslan</p>
      </nav>
    </>
  )
}

export default Footer;
